import React from 'react';
import './App.css';
import { useSelector } from 'react-redux';

function App() {
  const counter = useSelector(state => state.counter);
  const isLogged = useSelector(state => state.isLogged);

  return (
    <div className="App">
      <h1>{counter}</h1>
      <h3>{isLogged}</h3>
    </div>
  );
}

export default App;
